import React from "react";
import {
  ResponsiveContainer,
  AreaChart,
  Area,
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
} from "recharts";

// Цвета
const PRIMARY_COLOR = "#2563eb";
const QUALITY_COLORS = {
  высокий: "#16a34a",
  хороший: "#22c55e",
  средний: "#f59e0b",
  низкий: "#ef4444",
};

const Charts = ({ aggregations, loading }) => {
  if (!aggregations && !loading) return null;

  const {
    by_date = [],
    by_quality = [],
    by_model = [],
  } = aggregations || {};

  // --- 1. Динамика лидов (total)
  const leadsOverTime = by_date.map((d) => ({
    date: d.date,
    total: d.total || 0,
  }));

  // --- 2. Качество лидов (stacked)
  const qualityOverTime = by_date;

  // --- 3. Топ моделей
  const modelsData = [...by_model]
    .sort((a, b) => b.count - a.count)
    .slice(0, 8);

  return (
    <div className="space-y-6 mb-6">
      {/* ===================== */}
      {/* ГЛАВНЫЙ ГРАФИК */}
      {/* ===================== */}
      <div className="card p-4">
        <h2 className="mb-3 text-sm font-semibold text-slate-700">
          Динамика лидов во времени
        </h2>

        <div className="h-80">
          {loading ? (
            <div className="flex h-full items-center justify-center text-sm text-slate-400">
              Загрузка данных...
            </div>
          ) : leadsOverTime.length === 0 ? (
            <div className="flex h-full items-center justify-center text-sm text-slate-400">
              Недостаточно данных
            </div>
          ) : (
            <ResponsiveContainer width="100%" height="100%">
              <AreaChart data={leadsOverTime}>
                <CartesianGrid
                  strokeDasharray="3 3"
                  vertical={false}
                  stroke="#e5e7eb"
                />
                <XAxis dataKey="date" tick={{ fontSize: 12 }} />
                <YAxis allowDecimals={false} />
                <Tooltip />
                <Area
                  type="monotone"
                  dataKey="total"
                  stroke={PRIMARY_COLOR}
                  strokeWidth={2}
                  fill={PRIMARY_COLOR}
                  fillOpacity={0.15}
                  activeDot={{ r: 6 }}
                />
              </AreaChart>
            </ResponsiveContainer>
          )}
        </div>
      </div>

      {/* ===================== */}
      {/* ВТОРИЧНЫЕ ГРАФИКИ */}
      {/* ===================== */}
      <div className="grid gap-6 lg:grid-cols-2">
        {/* Качество лидов */}
        <div className="card p-4">
          <h2 className="mb-3 text-sm font-semibold text-slate-700">
            Качество лидов (по дням)
          </h2>

          <div className="h-64">
            {loading ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Загрузка данных...
              </div>
            ) : qualityOverTime.length === 0 ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Недостаточно данных
              </div>
            ) : (
              <ResponsiveContainer width="100%" height="100%">
                <BarChart data={qualityOverTime}>
                  <CartesianGrid
                    strokeDasharray="3 3"
                    vertical={false}
                    stroke="#e5e7eb"
                  />
                  <XAxis dataKey="date" tick={{ fontSize: 11 }} />
                  <YAxis allowDecimals={false} />
                  <Tooltip />
                  <Bar
                    dataKey="высокий"
                    stackId="a"
                    fill={QUALITY_COLORS["высокий"]}
                  />
                  <Bar
                    dataKey="хороший"
                    stackId="a"
                    fill={QUALITY_COLORS["хороший"]}
                  />
                  <Bar
                    dataKey="средний"
                    stackId="a"
                    fill={QUALITY_COLORS["средний"]}
                  />
                  <Bar
                    dataKey="низкий"
                    stackId="a"
                    fill={QUALITY_COLORS["низкий"]}
                  />
                </BarChart>
              </ResponsiveContainer>
            )}
          </div>
        </div>

        {/* Лиды по моделям */}
        <div className="card p-4">
          <h2 className="mb-3 text-sm font-semibold text-slate-700">
            Лиды по моделям Kia
          </h2>

          <div className="h-64">
            {loading ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Загрузка данных...
              </div>
            ) : modelsData.length === 0 ? (
              <div className="flex h-full items-center justify-center text-sm text-slate-400">
                Недостаточно данных
              </div>
            ) : (
              <ResponsiveContainer width="100%" height="100%">
                <BarChart
                  data={modelsData}
                  layout="vertical"
                  margin={{ left: 80 }}
                >
                  <XAxis type="number" allowDecimals={false} />
                  <YAxis
                    type="category"
                    dataKey="model"
                    width={80}
                    tick={{ fontSize: 12 }}
                  />
                  <Tooltip />
                  <Bar
                    dataKey="count"
                    fill={PRIMARY_COLOR}
                    radius={[6, 6, 6, 6]}
                  />
                </BarChart>
              </ResponsiveContainer>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Charts;
